import React, { Component } from 'react';

const TourCard = props => {

    onClick = () => {
        <TourPage props={props.tour}/>
    }

    return (
            <div className="tour-card">
                <img src={props.tour.tour_pic} alt={props.tour.title} onClick={this.handleClick}/>
            </div>
    )
}

export default TourCard
